import React from "react";
import "./Page.scss";

function Page() {
  return (
    <div className='page'>
      <div className='navigation'>
        <div className='profile'>
          <img src='./logo192.png' alt='' srcset='' />
        </div>
        <div className='navlist'>
          <img src="./svg/bx" alt="" srcset="" />
        </div>
      </div>
      <div className='main'></div>
      <div className='statistic'></div>
    </div>
  );
}

export default Page;
